css:
.hydrogen.output-bubble {
  color: #dfe1e0;
  padding-left: 2px;
  padding-right: 2px;
  border-radius: 3px;
  white-space: pre;
  display: inline-block;
}
.hydrogen.output-bubble.rich {
  border: none;
}
.hydrogen.output-bubble.rich .bubble-output-container {
  max-height: 500px;
  border-radius: 3px 0 3px 3px;
}
.hydrogen.output-bubble.rich.svg {
  background-color: white;
}
.hydrogen.output-bubble.rich .rich-close-button::before {
  color: #f9faf9;
  background-color: #35393c;
  display: block;
  cursor: pointer;
  border-radius: 0 3px 3px 0;
  width: 1.5em;
  height: 1.5em;
  line-height: 1.5em;
  text-align: center;
  box-shadow: 0 0 3px 0px rgba(0, 0, 0, 0.3);
}
.hydrogen.output-bubble:not(.multiline) {
  float: left;
  display: inline-flex;
  padding: 0;
  width: 100%;
}
.hydrogen.output-bubble:not(.multiline) .bubble-output-container {
  padding: 0 2px 0 2px;
  overflow: hidden;
}
.hydrogen.output-bubble:not(.multiline) .bubble-output-container pre {
  font-size: inherit;
  line-height: inherit;
  cursor: pointer;
}
.hydrogen.output-bubble.multiline {
  padding-right: 0px;
  display: flex;
  margin: 0px !important;
}
.hydrogen.output-bubble.multiline:not(.rich) .bubble-action-panel {
  display: inline-flex;
}
.hydrogen.output-bubble.multiline:not(.rich) .bubble-output-container {
  border-radius: 3px 0 0 3px;
  padding: 3px;
  padding-right: 7px;
  overflow: overlay;
}
.hydrogen.output-bubble.multiline:not(.rich) .rich-close-button::before {
  display: none;
}
.hydrogen.output-bubble.markdown .bubble-output-container {
  max-height: 500px;
}
.hydrogen.output-bubble.latex .bubble-output-container {
  padding: 3px;
}
.hydrogen.output-bubble .rich-close-button::before {
  display: none;
}
.hydrogen.output-bubble .bubble-output-container {
  color: #dfe1e0;
  background-color: #35393c;
  box-shadow: 0 0 3px 0 rgba(0, 0, 0, 0.3);
  z-index: 0;
  border-radius: 3px;
  display: inline-block;
  max-height: 250px;
  max-width: 95%;
  overflow: auto;
}
.hydrogen.output-bubble .bubble-result-container {
  width: fit-content !important;
  height: fit-content !important;
  max-width: unset !important;
  max-height: unset !important;
  overflow: hidden !important;
  white-space: normal;
}
.hydrogen.output-bubble .bubble-result-container pre {
  font-size: 12px;
  font-family: inherit;
  color: #dfe1e0;
  background-color: #35393c;
  margin: 0;
  padding: 0;
}
.hydrogen.output-bubble .bubble-result-container img,
.hydrogen.output-bubble .bubble-result-container svg {
  background-color: white;
}
.hydrogen.output-bubble .bubble-result-container video,
.hydrogen.output-bubble .bubble-result-container img,
.hydrogen.output-bubble .bubble-result-container svg {
  display: block;
  max-height: 500px !important;
  max-width: 100% !important;
  width: unset !important;
  height: unset !important;
}
.hydrogen.output-bubble .bubble-result-container td,
.hydrogen.output-bubble .bubble-result-container th {
  border: 1px solid #1d1f21;
  padding: 0.35em 0.7em;
  font-size: 12px;
}
.hydrogen.output-bubble .bubble-result-container .MathJax_SVG_Display {
  margin: 0;
}
.hydrogen.output-bubble .bubble-result-container .MathJax_SVG .noError {
  padding: 0;
  border: none;
  color: #e26463;
}
.hydrogen.output-bubble .bubble-result-container .MathJax_SVG svg {
  background-color: unset;
  margin: 0 !important;
  display: inline;
}
.hydrogen.output-bubble .bubble-error-container.plain-error pre {
  color: #e26463;
}
.hydrogen.output-bubble .bubble-error-container pre {
  font-size: 12px;
  font-family: inherit;
  color: #dfe1e0;
  background-color: #35393c;
  margin: 0;
  padding: 0;
}
.hydrogen.output-bubble .bubble-status-container::before {
  margin: 0px;
  font-size: 80%;
  width: 80%;
}
.hydrogen.output-bubble .bubble-action-panel {
  display: none;
  flex-direction: column;
  width: 30px;
  box-shadow: 0 0 3px 0 rgba(0, 0, 0, 0.3);
  border-radius: 0 3px 3px 0;
}
.hydrogen.output-bubble .bubble-action-panel .action-button {
  flex: none;
  border-top: 1px solid rgba(5, 6, 6, 0.2);
}
.hydrogen.output-bubble .bubble-action-panel .action-button:nth-child(1) {
  border-top: none;
  border-bottom: 1px solid rgba(5, 6, 6, 0.2);
}
.hydrogen.output-bubble .bubble-action-panel .action-button::before {
  width: 100%;
  height: 30px;
  color: #f9faf9;
  cursor: pointer;
  text-align: center;
  margin: 0;
  line-height: 30px;
}
.hydrogen.output-bubble .bubble-action-panel .padding {
  flex: 1;
}
.hydrogen.output-bubble .close-button::after {
  color: #f9faf9;
  background-color: #35393c;
  display: none;
  position: absolute;
  top: -12px;
  right: -12px;
  cursor: pointer;
  border-radius: 50%;
  padding: 1px;
  width: 1.5em;
  height: 1.5em;
  text-align: center;
  box-shadow: 0 0 2px 0px rgba(0, 0, 0, 0.5);
}
.hydrogen.watch-sidebar {
  width: 300px;
  min-width: 200px;
  overflow-y: overlay;
  padding: 10px;
  border-left: 1px solid #060708;
}
.hydrogen.watch-sidebar .toolbar .language {
  display: inline-block;
  padding: 4px;
}
.hydrogen.watch-sidebar .toolbar .btn-group {
  float: right;
}
.hydrogen.watch-sidebar .watch-view {
  width: 100%;
}
.hydrogen.watch-sidebar .watch-view .watch-input {
  margin-top: 10px;
  padding: 3px;
  border-radius: 3px;
  background-color: #1d1f21;
  font-size: 12px;
  min-height: 3em;
  border: 1px solid #060708;
}
.hydrogen.watch-sidebar .watch-view .history-switch {
  padding: 3px 0 3px 0;
  position: relative;
}
.hydrogen.watch-sidebar .watch-view .history-switch .counter {
  position: absolute;
  pointer-events: none;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
}
.hydrogen.watch-sidebar .watch-view .history-switch .next-btn {
  float: right;
}
.hydrogen.watch-sidebar .watch-view .history-switch .scrollbar {
  overflow-x: scroll;
  overflow-y: hidden;
  margin-top: -20px;
  margin-left: 23px;
  margin-right: 23px;
}
.hydrogen.watch-sidebar .watch-view .history-switch .scrollbar .hidden {
  height: 1px;
  width: 1000px;
  visibility: hidden;
  display: block !important;
}
.hydrogen.watch-sidebar .watch-view .history-switch .hide {
  display: none;
}
.hydrogen.watch-sidebar .watch-view .history-switch .show {
  display: block;
}
.hydrogen.watch-sidebar .watch-view .history-switch ::-webkit-scrollbar {
  height: 19px;
  -webkit-appearance: none;
}
.hydrogen.watch-sidebar .watch-view .history-switch ::-webkit-scrollbar-thumb {
  border-radius: 0;
  border: 1px solid #060708;
  background: #4d5a5e;
}
.hydrogen.watch-sidebar .watch-view .history-switch ::-webkit-scrollbar-thumb:hover {
  background: #1f2326;
}
.hydrogen.watch-sidebar .watch-resize-handle {
  position: absolute;
  top: 0px;
  bottom: 0px;
  left: -5px;
  width: 10px;
  cursor: ew-resize;
}
.hydrogen.watch-sidebar .add-watch {
  width: 100%;
  margin-top: 10px;
}
.hydrogen.watch-sidebar .output-bubble.empty {
  display: none;
}
.hydrogen.watch-sidebar .output-bubble {
  position: static;
  display: flex;
  float: none;
  border-radius: 3px;
  margin: 0px;
  font-size: 10px;
  box-shadow: none;
  padding-left: 0px;
  padding-right: 0px;
  border: 1px solid #060708;
}
.hydrogen.watch-sidebar .output-bubble.rich .rich-close-button {
  display: none;
}
.hydrogen.watch-sidebar .output-bubble:not(.rich) .bubble-action-panel {
  box-shadow: none;
  display: flex;
  flex-direction: column;
  width: 30px;
  background-color: #1d1f21;
}
.hydrogen.watch-sidebar .output-bubble:not(.rich) .bubble-output-container {
  border-radius: 3px 0 0 3px;
}
.hydrogen.watch-sidebar .output-bubble .bubble-output-container {
  display: inline-block;
  width: 100%;
  max-width: 100%;
  max-height: 350px;
  white-space: pre-wrap;
}
.hydrogen.watch-sidebar .output-bubble .bubble-result-container {
  max-width: inherit;
  max-height: inherit;
  position: relative;
}
.hydrogen.watch-sidebar .output-bubble .bubble-result-container pre {
  padding: 3px;
  font-size: inherit;
  display: block;
}
.hydrogen.watch-sidebar .output-bubble .bubble-result-container video,
.hydrogen.watch-sidebar .output-bubble .bubble-result-container img,
.hydrogen.watch-sidebar .output-bubble .bubble-result-container svg {
  height: 100%;
  width: 100%;
  max-height: 350px !important;
}
.hydrogen.watch-sidebar .output-bubble .bubble-error-container pre {
  font-size: inherit;
}
.hydrogen.status-container {
  display: inline-block;
  cursor: pointer;
  vertical-align: top;
}
.hydrogen.status-container .status:hover {
  text-decoration: underline;
}
.hidden {
  display: none;
}
.hydrogen .spinner {
  display: inline-block;
  text-align: center;
  line-height: 100%;
  position: relative;
  top: 1px;
}
.hydrogen .spinner > div {
  background-color: #ffffff;
  height: 100%;
  width: 2px;
  display: inline-block;
  -webkit-animation: stretchdelay 1.2s infinite ease-in-out;
  animation: stretchdelay 1.2s infinite ease-in-out;
}
.hydrogen .spinner .rect2 {
  -webkit-animation-delay: -1.1s;
  animation-delay: -1.1s;
  margin-left: 1px;
}
.hydrogen .spinner .rect3 {
  -webkit-animation-delay: -1s;
  animation-delay: -1s;
  margin-left: 1px;
}
.hydrogen .spinner .rect4 {
  -webkit-animation-delay: -0.9s;
  animation-delay: -0.9s;
  margin-left: 1px;
}
.hydrogen .spinner .rect5 {
  -webkit-animation-delay: -0.8s;
  animation-delay: -0.8s;
  margin-left: 1px;
}
@-webkit-keyframes stretchdelay {
  0%,
  40%,
  100% {
    -webkit-transform: scaleY(0.4);
  }
  20% {
    -webkit-transform: scaleY(1);
  }
}
@keyframes stretchdelay {
  0%,
  40%,
  100% {
    transform: scaleY(0.4);
    -webkit-transform: scaleY(0.4);
  }
  20% {
    transform: scaleY(1);
    -webkit-transform: scaleY(1);
  }
}
.plain-message.inspect-message {
  white-space: pre-wrap;
  font-size: 12px;
}
.plain-message.inspect-message span[style] {
  color: #b5bd68 !important;
}
.heading-summary.inspect-message span[style] {
  color: #b5bd68 !important;
}
atom-text-editor .gutter .line-number.breakpoint,
atom-text-editor::shadow .gutter .line-number.breakpoint {
  margin-bottom: -1px;
  border-bottom: 1px solid #b5bd68;
}
